#[derive(Debug)]
pub enum VendingApiError {
    IO(std::io::Error),
    HYPER(self::hyper::Error),
    SERDE(self::serde_json::Error),
}

impl From<self::serde_json::Error> for VendingApiError {
    fn from(err: self::serde_json::Error) -> Self {
        VendingApiError::SERDE(err)
    }
}

impl From<self::hyper::Error> for VendingApiError {
    fn from(err: self::hyper::Error) -> Self {
        VendingApiError::HYPER(err)
    }
}

impl From<std::io::Error> for VendingApiError {
    fn from(err: std::io::Error) -> Self {
        VendingApiError::IO(err)
    }
}

