/* API *******************************************************/
#[derive(Clone)]
pub struct VendingApi {
    vendors_url: String,
    buyers_url: String,
}

impl VendingApi {
    pub fn new() -> VendingApi {
        VendingApi { vendors_url: "http://riseofmidgard.com/api/vendors".to_string(), buyers_url: "http://riseofmidgard.com/api/buyers".to_string() }
    }

    pub fn vending(&self) -> impl Future<Item=Vec<ItemOnSale>, Error=VendingApiError> {
        let client = Client::new();
        let vendors_url = self.vendors_url.clone();

        lazy(move || {
            let mut resp_str = String::new();
            let mut response = client.get(&vendors_url).send()?;

            response.read_to_string(&mut resp_str);

            let saned_str = resp_str.replace("\\", ""); //Response is badly formatted, we have to get rid of some anteslashes.

            //            println!("{:?}", saned_str);

            let deserialized: VendingResponse = serde_json::from_str(&saned_str)?;

            Ok(deserialized.data)
        })
    }

    pub fn buying(&self) -> impl Future<Item=Vec<BuyingItem>, Error=VendingApiError> {
        let client = Client::new();
        let buying_url = self.buyers_url.clone();

        lazy(move || {
            let mut resp_str = String::new();
            let mut response = client.get(&buying_url).send()?;

            response.read_to_string(&mut resp_str);

            let saned_str = resp_str.replace("\\", "");

            let deserialized: BuyingResponse = serde_json::from_str(&saned_str)?;

            Ok(deserialized.data)
        })
    }
}


